import axios from "axios";
import { config } from "../../utils/config";
import * as actionType from "../Actions/Types"

import {
  GET_PRICING_FILTER_DATA,
  GET_ERROR,
  GET_PRICING_FACTOR_DATA,
  PRICING_LINE_DATA,
  COMPETITOR_DATA,
  GENERATE_RECOMMENDATION_DATA,
  GET_REGION_DATA,
  GET_STORE_DATA,
  GET_SIMULATION_DATA,
  SAVE_SIMULATION_DATA,
  SELECTEDVALS_INTO_STORE,
  GET_REF_PRODUCTS,
  GET_REF_PRODUCTS_SUCCESS,
  GET_REF_PRODUCTS_FAILURE
} from "./Type";

import {
  GET_ALL_CASCADING_FILTERS,
  GET_ALL_CASCADING_FILTERS_SUCCESS,
  GET_ALL_CASCADING_FILTERS_ERR,
} from "../../actions/types"

export const getCompetitorsPricing = params => dispatch => {
  dispatch({
    type: actionType.COMPETITORS_PRICING
  });
  var url = config.markDownUrl + `/pricing/newCompetitor`;

  axios
    .get(url)
    .then(res => {
      dispatch({
        type: actionType.COMPETITORS_PRICING_SUCCESS,
        payload: res.data
      });
    })
    .catch(err => {
      dispatch({
        type: actionType.COMPETITORS_PRICING_FAILURE,
        payload: err
      });
    });
};

export const getNewproductRegion = params => dispatch => {
  dispatch({
    type: actionType.NEW_PRODUCT_REGION
  });
  var url = config.markDownUrl + `/pricing/region`;

  axios
    .get(url)
    .then(res => {
      dispatch({
        type: actionType.NEW_PRODUCT_REGION_SUCCESS,
        payload: res.data
      });
    })
    .catch(err => {
      dispatch({
        type: actionType.NEW_PRODUCT_REGION_FAILURE,
        payload: err
      });
    });
};

export const saveNewProductPricing = params => dispatch => {
  dispatch({
    type: actionType.SAVE_NEW_PRICING
  });
  var url = config.markDownUrl + `/pricing/createPlan`;

  axios
    .post(url, params)
    .then(res => {
      dispatch({
        type: actionType.SAVE_NEW_PRICING_SUCESS,
        payload: res.data
      });
    })
    .catch(err => {
      dispatch({
        type: actionType.SAVE_NEW_PRICING_ERR,
        payload: err
      });
    });
};

export const getNewproductStore = params => dispatch => {
  dispatch({
    type: actionType.NEW_PRODUCT_STORE
  });
  var url = config.markDownUrl + `/pricing/store`;

  axios
    .get(url)
    .then(res => {
      dispatch({
        type: actionType.NEW_PRODUCT_STORE_SUCESS,
        payload: res.data
      });
    })
    .catch(err => {
      dispatch({
        type: actionType.NEW_PRODUCT_STORE_FAILURE,
        payload: err
      });
    });
};


export const getPricingFilter = params => async dispatch => {
  var url = config.markDownUrl + `/pricing/allProducts`;
  if (params) {
    url += `?${params}`
  }
  let response = await axios
    .get(url)
    .then(res => {
      console.log("getpricingData", res);
      dispatch({
        type: GET_PRICING_FILTER_DATA,
        payload: res.data
      });
      return res
    })
    .catch(err => {
      dispatch({
        type: GET_ERROR,
        payload: err
      });
    });
  return response;
};


export const getPricingNewFilter = params => async dispatch => {
  var url = config.markDownUrl + `/pricing/pricingfilterNew`;
  if (params) {
    url += `?${params}`
  }
  let response = await axios
    .get(url)
    .then(res => {
      console.log("getpricingData", res);
      dispatch({
        type: GET_PRICING_FILTER_DATA,
        payload: res.data
      });
      return res
    })
    .catch(err => {
      dispatch({
        type: GET_ERROR,
        payload: err
      });
