  return response;
};


export const getPricingFactorData = params => dispatch => {

  var url = config.markDownUrl + `/pricing/factorSummary`;
  if (params) {
    url += `?${params}`
  }
  axios
    .get(url)
    .then(res => {
      console.log("getpricingGraphData", res);
      dispatch({
        type: GET_PRICING_FACTOR_DATA,
        payload: res.data
      });
    })
    .catch(err => {
      dispatch({
        type: GET_ERROR,
        payload: err
      });
    });
};


export const getPricingLineData = params => dispatch => {
  // dispatch({
  //   type: LOADER,
  //   payload: true
  // });
  axios.get(`${config.markDownUrl}/markdown/skuHistory${params}`).then(res => {
    dispatch({
      type: PRICING_LINE_DATA,
      payload: res.data.data
